query search($query: JSON!, $sort: JSON!) {
  search(limit: 10, offset: 0, query: $query, sort: $sort) {
    items {
      _id
      title
      schema {
        _id
      }
      isCollection
      parentId
      externalId
      ancestors {
        title
      }
    }
    total
    limit
    offset
    totalRelation
    aggregations
    __typename
  }
}
